import React, { Component } from "react";
import "./style.css";

import apartment from "../images/apartment.jpeg";
import bangalow from "../images/banglow.jpeg";
import homeimage from "../images/home-image.png";
import miniservices from "../images/miniservice.jpeg";

export default class ServiceList extends Component {
  render() {
    return (
      <div className="three-column-layout">
        <div className="side left">
          <div style={{ display: "flex", alignItems: "center", gap: "10px" }}>
            <p className="text-secondary">Select a service</p>
            <hr
              style={{
                flex: 1,
                border: "none",
                borderTop: "1px solid black",
                position: "relative",
                top: "-6px", // adjust up or down until visually centered
              }}
            />
          </div>
          <div className="container ">
            <div className="row ">
              <div className="col-md-4 col-12 mb-3 flex-column align-items-center justify-content-between ">
                <img className="service-logo" src={apartment} />
                <p className="hover-underline ms-2">Apartment</p>
              </div>
              <div className="col-md-4 col-12 mb-3 flex-column align-items-center justify-content-between">
                <img className="service-logo" src={bangalow} />
                <p className="hover-underline ms-2">
                  Bungalow/
                  <br />
                  duplex
                </p>
              </div>
              <div className="col-md-4 col-12 mb-3 flex-column align-items-center justify-content-between">
                <img className="service-logo" src={homeimage} />
                <p className="hover-underline">Book by room</p>
              </div>
              <div className="col-md-4 col-12 mb-3 flex-column align-items-center justify-content-between ">
                <img className="service-logo" src={miniservices} />
                <p className="hover-underline">Mini services</p>
              </div>
            </div>
          </div>
        </div>

        <div className="main-content">
          {[...Array(30)].map((_, i) => (
            <div key={i} className="list-item">
              Item #{i + 1}
            </div>
          ))}
        </div>

        <div className="side right">
          <h4>Summary</h4>
          <p>Right sidebar content</p>
        </div>
      </div>
    );
  }
}
